const articleLike = (state = {likes: 0}, action) => {

  switch (action.type) {
    case "LIKE_ARTICLE":
        return Object.assign({}, state, {
        likes: parseInt(action.likes)
        })
    default:
      return state;
  }
};
export default articleLike;
